    private String name;
    private String texture;
    private String uuid;

    @Getter
    private static final Map<String, MicroBlock> BY_NAME = Maps.newHashMap();

    MicroBlock(final String name, final String texture, final String uuid) {
        this.name = name;
        this.texture = texture;
        this.uuid = uuid;
    }

    public static MicroBlock getMicroBlock(String string){
        return BY_NAME.get(string);
    }

    static {
        for(MicroBlock type: values()){
            BY_NAME.put(type.name,type);
        }
    }


